import React, { useEffect } from 'react';
import { useLocation } from 'react-router-dom';

export default function Delete() {
  const location = useLocation();
  const { data } = location.state;

  useEffect(() => {
    // Lógica para llamar a la función en tu backend y pasarle la data
    const fetchData = async () => {
      try {
        const response = await fetch(`http://localhost:80/eliminado`, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify(data)
        });
        if (response.ok) {
          const responseData = await response.json();
          console.log('Respuesta del backend:', responseData);
        } else {
          console.error('Error al llamar al backend:', response.statusText);
        }
      } catch (error) {
        console.error('Error de red:', error);
      }
    };

    // Llama a la función fetchData al montar el componente
    fetchData();
  }, [data]);

  // Resto del código...
}
